import React from "react";
import { HashRouter as Router, Route, NavLink } from "react-router-dom";
import CitizenLogin from "./pages/Citizen/LoginPage";
import LHCLogin from "./pages/LHCProcessor/LHCLogin";

import "./App.css";

const AppOne =() =>{
  return (
    <Router basename="/digipal/">
    <div className="App">
      <div className="appAside">digipal</div>
      <div className="appForm">
        {/* <div className="pageSwitcher">
          <NavLink
            to="/LHC"
            activeClassName="pageSwitcherItem-active"
            className="pageSwitcherItem"
          >
            LHC
          </NavLink>
          <NavLink
            exact
            to="/Citizen"
            activeClassName="pageSwitcherItem-active"
            className="pageSwitcherItem"
          >
            CITIZEN
          </NavLink>
        </div> */}

        <div>
          <NavLink
            to="/LHC"
          >
           LHC
          </NavLink>{" "}
          or{" "}
          <NavLink
            exact
            to="/Citizen"
          >
            CITIZEN
          </NavLink>
        </div>

        <Route exact path="/Citizen" component={CitizenLogin} />
        <Route path="/LHC" component={LHCLogin} />
      </div>
    </div>
  </Router>
  )
}


